    <script
      src="https://code.jquery.com/jquery-3.3.1.js"
      integrity="sha256-2Kok7MbOyxpgUVvAk/HJ2jigOSYS2auK4Pfzbm7uH60="
      crossorigin="anonymous"></script>
    <script>
    $(function() {
      panZoomInstance = svgPanZoom('#example', {
        zoomEnabled: true,
        panEnabled: true,
        controlIconsEnabled: false,
        dblClickZoomEnabled: true,
        mouseWheelZoomEnabled: true,
        preventMouseEventsDefault: true,
        controlIconsEnabled: true,
        fit: true,
        center: true,
        minZoom: 1.7,
        maxZoom: 25,
      });

      panZoomInstance.zoom(0.4)

      window.setInterval(function() {
         if(panZoomInstance.getZoom()>13){
             document.getElementById("floor3").style.opacity = 1;
             document.getElementById("informationLevel3").style.opacity = 1;
             document.getElementById("informationLevel2").style.opacity = 0;
             document.getElementById("informationLevel1").style.opacity = 0;
         }
         else if (panZoomInstance.getZoom()>3 && panZoomInstance.getZoom()<=13) {
             document.getElementById("floor3").style.opacity = 1;
             document.getElementById("informationLevel3").style.opacity = 0;
             document.getElementById("informationLevel2").style.opacity = 1;
             document.getElementById("informationLevel1").style.opacity = 0;
         }
         else {
             document.getElementById("floor3").style.opacity = 0;
             document.getElementById("informationLevel3").style.opacity = 0;
             document.getElementById("informationLevel2").style.opacity = 0;
             document.getElementById("informationLevel1").style.opacity = 1;

         }
     }, 100)

    })
    </script>


    <script>

        var myElement = document.getElementById('myMap');

        var mc = new Hammer.Manager(myElement);

        // create a pinch and rotate recognizer
        // these require 2 pointers
        var pinch = new Hammer.Pinch();
        var rotate = new Hammer.Rotate();

        // we want to detect both the same time
        pinch.recognizeWith(rotate);

        // add to the Manager
        mc.add([pinch, rotate]);


        mc.on("pinch rotate", function(ev) {
            svgPanZoom.zoom(15);
        });

    </script>

</body>
